<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Generated Career Profile</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <style>
        /* Custom Scrollbar for Webkit browsers (Chrome, Safari) */
        ::-webkit-scrollbar {
            width: 10px;
            background-color: #1a1a2e;
        }
        ::-webkit-scrollbar-track {
            background: #1a1a2e;
            border-radius: 10px;
        }
        ::-webkit-scrollbar-thumb {
            background: linear-gradient(180deg, #4f46e5 0%, #8b5cf6 100%);
            border-radius: 10px;
            border: 2px solid #1a1a2e;
        }
        ::-webkit-scrollbar-thumb:hover {
            background: linear-gradient(180deg, #a5b4fc 0%, #c4b5fd 100%);
        }

        /* Smooth scroll behavior */
        html {
            scroll-behavior: smooth;
        }

        /* Glassmorphism effect */
        .glassmorphism {
            background: rgba(255, 255, 255, 0.05);
            backdrop-filter: blur(15px) saturate(180%);
            -webkit-backdrop-filter: blur(15px) saturate(180%);
            border-radius: 12px;
            border: 1px solid rgba(255, 255, 255, 0.18);
            box-shadow: 0 8px 32px 0 rgba(0, 0, 0, 0.37);
        }

        /* Subtle hover animations for interactive elements */
        .interactive-card:hover {
            transform: translateY(-8px) scale(1.02);
            box-shadow: 0 12px 32px 0 rgba(0, 0, 0, 0.45);
            transition: transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out;
        }
        .interactive-card {
            transition: transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out;
        }

        /* Keyframe animation for pulsating glow */
        @keyframes pulsate-glow {
            0% {
                box-shadow: 0 0 10px rgba(129, 140, 248, 0.6), 0 0 20px rgba(129, 140, 248, 0.4);
            }
            50% {
                box-shadow: 0 0 20px rgba(129, 140, 248, 0.8), 0 0 30px rgba(129, 140, 248, 0.6);
            }
            100% {
                box-shadow: 0 0 10px rgba(129, 140, 248, 0.6), 0 0 20px rgba(129, 140, 248, 0.4);
            }
        }

        .pulsating-glow {
            animation: pulsate-glow 4s infinite;
        }
    </style>
</head>
<body class="bg-gradient-to-br from-slate-900 via-slate-800 to-slate-900 min-h-screen flex items-center justify-center p-6 md:p-12 font-sans antialiased text-white">

                        'card-gradient': 'linear-gradient(135deg, #262d3c 0%, #3a3f50 100%)',

                    boxShadow: {

            }
